I’ve been struggling for a while now to find my place in the world. I have a supportive family, a loving partner, amazing friends, and yet I can’t shake the feeling that I’m a complete and utter failure. I graduated from my university back in April as a triple major after four years of school, something I’m extremely proud of myself for, and yet I haven’t received a single phone call, email, smoke signal, anything, regarding applications I’ve submitted for employment... it’s been nearly 6 months, and well over 150 applications, and it’s really taking a toll on me, let me tell you. Everyone keeps telling me it takes time, but I feel as if I’m stuck in a frozen state with little to no personal growth as my friends and family continue to flourish around me. I wish I could do the same.
