I thought I would be at my Grandparents and in my Gaming Room today, but I'm not. Which means, I haven't been able to take new photos. I haven't been there for two weeks and sadly I didn't take enough photos to keep posting right now. Looks like I'll be there late next week. So I'll be quiet until then. Which really sucks. But anyway, here is a picture I haven't posted yet. And to no surprise, it's Zelda related. I have been playing so much Zelda lately. And I'm enjoying Links Awakening so much! I've done two dungeons and I already have 7 hearts. I can't wait to play more. I don't want it to end!
